import React from "react";
import { Link } from 'react-router-dom'
import "./Home.css";
function Home() {
  return (
      <>
      <div className="container">
        <input type="text" className="search mt-5" placeholder="search . . ."/>
        <button type="button" class="btn btn-warning ms-2 mb-2">Search</button>
        <button type="button" class="btn btn-primary ms-2 mb-2">Add<Link to="addtodo"></Link></button>
      </div>
    </>
  );
}

export default Home;
